"use strict";

const accumulate = (arr, initial) => {
    let sum = initial;
    return arr.map(val => sum += val);
};

const f_gold = (nums, k) => {
    const s = accumulate(nums, 0);
    let ans = 0;
    for (let i = 1; i <= nums.length; i++) {
        if (nums[i - 1] >= k) {
            continue;
        }
        let left = 1, right = i;
        while (left < right) {
            const mid = (left + right + 1) >> 1;
            if ((s[i] - s[i - mid]) * mid < k) {
                left = mid;
            } else {
                right = mid - 1;
            }
        }
        ans += left;
    }
    return ans;
};
